export const BUTTON_STATUS = {
  CALL: 'call',
  ARRIVED: 'arrived',
  WAITING: 'waiting'
}

export const TIMER = {
  STOP: [
    'stop',
    {opacity: 0}
],
  START: [
    'start',
    {opacity: 1}
  ],
  RESET: [
    'reset',
    {opacity: 0}
  ]
}
